import React from 'react';

const RegisterAdmin = () => {
    return (
        <div>
            <h1>Admin Registration</h1>
            <p>Register as an admin to manage the Yummi Food Ordering platform.</p>
        </div>
    );
};

export default RegisterAdmin;
